const VideoItem = (props) => (
  <li>
    <h1>{props.video.snippet.title}</h1>
    <h2>{props.video.snippet.channelTitle}</h2>
    <img src={props.video.snippet.thumbnails.medium.url} alt="video thumnail" />
  </li>
);

export default VideoItem;
